import './App.css';
import React, { useState, useEffect } from "react";
import axios from "axios";

function Home() {
  const [data, setData] = useState([]);


  useEffect(() => {
    axios
      .get("http://localhost/HW3/index.php")
      .then((response) => {
        setData(response.data); // Assuming the data received is an array
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);

  return (
    <div>
      {data.map((item) => (
        <p key={item.id}>
          Artist: {item.artist}, Song: {item.song}, Rating: {item.rating}
        </p>
      ))}
    </div>
  );
}

export default Home;
